// 기물을 취할수 있는지 여부
function Janggi_CheckEaten(board, from, to){
    let f_p = board.coords[from].piece;
    let t_p = board.coords[to].piece;

    if( f_p.toLowerCase() == 'c' && // 포끼리는 불가능
        t_p.toLowerCase() == 'c' ){
        return false;
    } else if( f_p.toLowerCase() == f_p &&  // 한나라끼리 불가능
               t_p.toLowerCase() == t_p ) {
        return false;
    } else if( f_p.toUpperCase() == f_p && // 초나라끼리불가능
               t_p.toUpperCase() == t_p ) {
        return false;
    }
    return true;
}


// 보드 위치의 기물이 가질수 있는 이동가능 후보
function Janggi_GetCands(board, pos) {
    let ret = [];
    let piece = board.coords[pos].piece;
    if(piece != ''){
        let dirs = [0,1,2,3,4,5,6,7];
        let step_cnt = 1;
        let is_cannon = false;
        let is_jump = false;
        let cands_map = janggi_link_cands;

        switch(piece){
            case 'r': case 'R': // Rook (차)
            step_cnt = 20;
            break;
            
            case 'c': case 'C': // Cannon (포)
            step_cnt = 20;
            is_cannon = true;
            break;

            case 'p': // 병
            dirs = [0,2,3,6,7];
            break;

            case 'P': // 졸
            dirs = [0,1,2,4,5];
            break;

            case 'n': case 'N': // Knight (마)
            step_cnt = 2;
            cands_map = janggi_knight_cands;
            is_jump = true; // 뛰는 기물
            break;

            case 'e': case 'E': // Elephant (상)
            step_cnt = 3;
            cands_map = janggi_elephant_cands;
            is_jump = true; // 뛰는 기물
            break;

            case 'a': case 'A':  // Advisor (사)
            case 'k': case 'K':  // King   (왕)
            cands_map = janggi_gung_cands;
            break;
        }

        //
        // 장기 이동 규칙
        //
        let routes = cands_map[pos];
        for(let i=0; i < dirs.length; i++){
            // 기물별 확인 방향
            let steps = routes[dirs[i]];
            let chk_cannon = is_cannon;
            for(let j=0; j < steps.length && j < step_cnt; j++){
                let step = steps[j];
                let step_piece = board.coords[step].piece;
                if(step_piece != ''){
                    // 기물이 있는 경우
                    if(chk_cannon){
                        if(step_piece.toLowerCase() == 'c'){
                            break; // 포끼리 못 넘음
                        }
                        // 포다리 찾음
                        chk_cannon = false;
                        continue;
                    } else if (is_jump && j < steps.length-1){
                        // 뛰는 기물인데 마지막 스텝이 아닌경우
                        // 멱이 막힘
                        break;
                    } else {
                        // 기물을 취하는게 가능한지 여부
                        if(Janggi_CheckEaten(board, pos, step)){
                            ret.push(step); // 가능하면 추가
                        }
                        break;
                    }
                }else{
                    // 기물이 없는 경우
                    if(chk_cannon){
                        //pass
                    } else if(is_jump) {
                        // 뛰는 기물 마지막 스텝이 비어있는 경우
                        if( j == steps.length-1 ){
                            ret.push(step);
                        }
                    } else {
                        // 그외 기물들은 비어있으면 후보로 등록한다.
                        ret.push(step);
                    }
                }
            }
        } // for dirs
    }

    return ret;
}


