// 이벤트 세팅
function __Janggi_SetEvent(board) {
    board.before_click = null;
    for(let k in board.coords){
        let obj = board.coords[k];
        let cell = board.querySelector('div[cell_id="' + obj.cell_id + '"]');
        
        cell.addEventListener('click', function(e){
            if(Janggi_IsDraggable(board) == false) {
                return ;
            }
            // 좌표
            let coord = board.ref_coords[parseInt(cell.getAttribute('cell_id'))];
            // 턴확인
            if(Janggi_CheckTurn(board, board.coords[coord].piece) == false){
                return ;
            }
            if (board.coords[coord].piece != ''){
                if (board.before_click != null){
                    board.coords[board.before_click].highlight = false;
                }
                board.coords[coord].highlight = true;
                board.before_click = coord;
                if(board.ilegalmove == false) {
                    // get dest
                    let dest = Janggi_GetCands(board, coord);
                    // clear
                    for(let d of board.before_dest){
                        board.coords[d].dest = false;
                    }
                    // set
                    for(let d of dest){
                        board.coords[d].dest = true;
                    }
                    board.before_dest = dest;
                }
                Janggi_Render(board);
            }            
        });
        cell.addEventListener('dragenter', function(e) {
            e.preventDefault();
            //cell.classList.add('janggi_default_highlight');
        });
        cell.addEventListener('dragleave', function(e) {
            e.preventDefault();
            //cell.classList.remove('janggi_default_highlight');
        });
        cell.addEventListener('dragover', function(e) { e.preventDefault(); });
        cell.addEventListener('drop', function(e) {
            // 드래그해온 엘리먼트 선택
            let from_coord = e.dataTransfer.getData('text/plain');
            let to_coord = board.ref_coords[parseInt(cell.getAttribute('cell_id'))];
            // 목표지점 아니면 이동하지 않음
            if (board.ilegalmove == false &&
                board.coords[to_coord].dest == false){
                return ;
            }
            
            // 이동가능한 경우

            if (board.before_click != null){
                board.coords[board.before_click].highlight = false;
            }
            board.coords[to_coord].highlight = true;
            board.before_click = to_coord;
            Janggi_Move(board, from_coord, to_coord);
            // clear dest
            for(let d of board.before_dest){
                board.coords[d].dest = false;
            }
            Janggi_Render(board);
        });
    }
}



// 보드 렌더링 (변경사항을 모두 반영)
function Janggi_Render(board) {
    // clear
    let pieces = board.querySelectorAll('img[piece]');
    for (let i = 0; i < pieces.length; i++) {
        board.hidden_elem.appendChild(pieces[i]);
    }
    //let cells = board.querySelectorAll('div[cell_id]');
    for (let i = 0; i < board.cell_elems.length; i++) {
        board.cell_elems[i].classList.remove('janggi_default_highlight');
        board.cell_elems[i].classList.remove('janggi_default_dest');
    }
    // set all coord
    for (let key in board.coords) {
        let coordobj = board.coords[key];
        //let cell = board.querySelector('div[cell_id="' + coordobj.cell_id + '"]');
        let cell = board.cell_elems[coordobj.cell_id];
        if (coordobj.piece != '') {
            let piece = board.hidden_elem
                .querySelector(
                    'img[piece="' + coordobj.piece + '"]'
                );
            cell.appendChild(piece);
        }
        if (coordobj.highlight == true) {
            cell.classList.add('janggi_default_highlight');
        }
        if (coordobj.dest == true) {
            cell.classList.add('janggi_default_dest');
        }
    }
    // remove remain pieces
    while (board.hidden_elem.firstChild) {
        board.hidden_elem.removeChild(board.hidden_elem.lastChild);
    }
}


// utils
function __Janggi_strip(str) {
    return str.replace(/\s+/g, ' ').trim();
}

function __Janggi_FEN(position_str) {
    let fen_str = position_str;
    if (position_str == "start") {
        // 좌귀마(초) vs 우귀마(한)
        fen_str = "rena1aenr/4k4/1c5c1/p1p1p1p1p/9/9/P1P1P1P1P/1C5C1/4K4/RENA1AENR";
    } else if (/\[([A-Za-z-]*)\]\[([A-Za-z-]*)\]/.test(position_str)) {
        let arr = position_str.match(/\[([A-Za-z-]*)\]\[([A-Za-z-]*)\]/);

        // 한 포진
        if (arr[1].toLowerCase() == 'left-knight') {
            fen_str = "rnea1aner/4k4/1c5c1/p1p1p1p1p/";
        } else if (arr[1].toLowerCase() == 'right-knight') {
            fen_str = "rena1aenr/4k4/1c5c1/p1p1p1p1p/";
        } else if (arr[1].toLowerCase() == 'doubled-knight') {
            fen_str = "rena1aner/4k4/1c5c1/p1p1p1p1p/";
        } else if (arr[1].toLowerCase() == 'coupled-knight') {
            fen_str = "rnea1aenr/4k4/1c5c1/p1p1p1p1p/";
        } else {
            fen_str = "9/9/9/9/";
        }
        // 중간
        fen_str += "9/9/";

        // 초 포진
        if (arr[2].toLowerCase() == 'left-knight') {
            fen_str += "P1P1P1P1P/1C5C1/4K4/RENA1AENR";
        } else if (arr[2].toLowerCase() == 'right-knight') {
            fen_str += "P1P1P1P1P/1C5C1/4K4/RNEA1ANER";
        } else if (arr[2].toLowerCase() == 'doubled-knight') {
            fen_str += "P1P1P1P1P/1C5C1/4K4/RENA1ANER";
        } else if (arr[2].toLowerCase() == 'coupled-knight') {
            fen_str += "P1P1P1P1P/1C5C1/4K4/RNEA1AENR";
        } else {
            fen_str += "9/9/9/9";
        }
    }
    return fen_str;
}

